import Link from "next/link";

const Navbar = () => (
  <div className="navbar">
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/portfolio">
          <a>Portfolio</a>
        </Link>
      </li>
      <li>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </li>
      <li>
        <Link href="blog">
          <a>Blog</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      .navbar {
        width: 30%;
        float: right;
      }

      .navbar ul {

        list-style: none;
        padding: 0px;
      }

      .navbar li {
        padding: 5px;
        display: inline;
      }

      .navbar a {
        color: black;
        text-decoration: none;
        font-size: 18px;
        padding-right: 15px;
      }

      .navbar a:hover {
        color: red;
      }
    `}</style>
  </div>
);

export default Navbar;
